import React from "react";
import ListItem from "./ListItem";
import NewStudent from './NewStudent';

function Students({name, id, handleRemove, handleAddNew}){
  console.log("(S)name: ", name)
  console.log("(S)..id: ", id)

  const displayNames = name.filter((names)=>{
    return names
  })
  const displayIds = id.map((ids)=>{
    return ids
  })

  console.log("(S)Display names id: ", displayIds)
  return(
    <div>
      <header>
        Currently Enrolled Students
      </header>
      <NewStudent onAddNewStudent={handleAddNew}/>

      {displayNames.map = ((names) =>{
        <ListItem 
          key={id}
          id={id}
          student_name={names}
          onRemove={handleRemove}
        /> 
        })
      }


    </div>
  )
}

export default Students;
